                    ///\n          1.WHEN THE FIRST FARE COMPONENT IS CHANGED -\n          THE ENTIRE TICKET MUST BE RE-PRICED USING\n          -CURRENT- FARES IN EFFECT ON THE DATE OF NEW\n          TICKET ISSUANCE.\n          ---\n          NEW FARE AMOUNT SHOULD BE EQUAL OR HIGHER THAN\n          PREVIOUS AMOUNT.\n          ---\n          ANY DIFFERENCE IN FARES PLUS CHANGE FEE MUST BE\n          COLLECTED.\n          ---\n          ALL RULE PROVISIONS OF THE NEW FARE INCLUDING\n          ADVANCE PURCHASE/MIN STAY/MAX STAY/\n          SEASONALITY/ETC MUST BE MET.\n          ---\n          2.WHEN THERE ARE NO CHANGE TO THE FIRST FARE\n          COMPONENT BUT OTHER FARE COMPONENTS ARE CHANGED -\n          THE ENTIRE TICKET MUST BE RE-PRICED USING\n          -HISTORICAL- FARES IN EFFECT ON THE DATE OF\n          ORIGINAL TICKET ISSUE.\n          ---\n          NEW FARE AMOUNT SHOULD BE EQUAL OR HIGHER THAN\n          PREVIOUS AMOUNT.\n          ---\n          ANY DIFFERENCE IN FARES PLUS CHANGE FEE MUST BE\n          COLLECTED.\n          ---\n          ALL RULE PROVISIONS OF THE NEW FARE INCLUDING\n          ADVANCE PURCHASE/MIN STAY/MAX STAY/\n          SEASONALITY/ETC MUST BE MET.\n          ---           ///\n          // CHANGES AFTER DEPARTURE //\n                        ///\n          THE ENTIRE TICKET MUST BE RE-PRICED USING\n          -HISTORICAL- FARES IN EFFECT ON THE DATE OF\n          ORIGINAL TICKET ISSUE.\n          ---\n          NEW FARE AMOUNT SHOULD BE EQUAL OR HIGHER THAN\n          PREVIOUS AMOUNT.\n          ---\n          ANY DIFFERENCE IN FARES PLUS CHANGE FEE MUST BE\n          COLLECTED.\n          ---\n          ALL RULE PROVISIONS OF THE NEW FARE INCLUDING\n          ADVANCE PURCHASE/MIN STAY/MAX STAY/\n          SEASONALITY/ ETC MUST BE MET.\n \n   GENERAL RULE - APPLY UNLESS OTHERWISE SPECIFIED\n         NOTE - TEXT BELOW NOT VALIDATED FOR AUTOPRICING.\n          /// CANCELLATION PROVISIONS ///\n          ---\n          CHARGE APPLY PER TRANSACTION.\n          CHILD DISCOUNT DOES NOT APPLY.\n          INFANT WITHOUT OF SEAT FREE OF CHARGE.\n          ---\n          RULES FOR CANCELLATION APPLY BY PRICING UNIT.\n          WHEN COMBINING ON A HALF ROUNDTRIP BASIS THE MOST\n          RESTRICTIVE CANCELLATION CONDITIONS APPLIES FOR\n          THE ENTIRE PRICING UNIT.\n          ---\n          PENALTIES WAIVED FOR DEATH OF PASSENGER/\n          TRAVELLING COMPANION/FAMILY MEMBER/RELATIVE.\n          FAMILY MEMBER - SPOUSE/CHILDREN/ADOPTED CHILDREN/\n          PARENTS.\n          RELATIVE -\n          GRANDFATHER/GRANDMOTHER/GRANDSONS/SISTERS/BROTHERS\n          ---\n          REFUND OF UNUSED FEES AND TAXES PERMITTED.\n          ---\n          IF REFUND PERMITTED FLIGHTS SEGMENTS MUST BE\n          CANCELLED NO LATER THAN CHECK-IN CLOSE TIME.\n          IN SUCH CASE A REFUND MAY BE REQUESTED DURING\n          TICKET VALIDITY PERIOD.\n          OTHERWISE NO-SHOW PROVISIONS APPLY.\n          ---\n          PERIOD VALIDITY FOR SPECIAL FARE WILL BE FARE MAX\n          STAY FROM THE DATE ON THE FIRST FLIGHT COUPON OF\n          ORIGINAL TICKET.\n          ---\n          PAPER TICKET SURCHARGE IS NOT REFUNDABLE AT ANY\n          TIME.\n          ---\n          IN CASE OF CANCELLATION AFTER DEPARTURE REFUND\n          THE DIFFERENCE BETWEEN THE FARE PAID AND THE\n          APPLICABLE FARE FLOWN. REFUND FEE APPLIES.\n          ---\n          /// CHANGES PROVISIONS ///\n          ---\n          CHARGE APPLY PER TRANSACTION.\n          CHILD DISCOUNT APPLY.\n          INFANT WITHOUN A SEAT FREE OF CHARGE.\n          ---\n          CHANGE IS A ROUTING/DATE/FLIGHT/BOOKING CLASS/FARE\n          MODIFICATION.\n          ---\n          RULES FOR CHANGES APPLY BY FARE\n          COMPONENT/DIRECTION.\n          IN CASE OF COMBINATION CHARGE THE HIGHEST FEE OF\n          ALL CHANGED FARE COMPONENTS.\n          ---\n          WHENEVER A NONREFUNDABLE FARE TICKET IS REISSUED\n          A NONREFUNDABLE NOTATION MUST BE MADE IN THE\n          ENDORSEMENT BOX OF THE NEW TICKET.\n          THE ORIGINAL NONREFUNDABLE VALUE REMAINS\n          NONREFUNDABLE FOR ANY SUBSEQUENT REISSUES.\n          ---\n          CHANGES ARE NOT PERMITTED AFTER THE DEPARTURE\n          TIME SHOWN ON THE APPLICABLE FLIGHT COUPON /INCL\n          NO-SHOW/.\n          IN THIS CASE TICKET HAS NO VALUE.\n          EXCEPTION - FARE RULES WHICH ALLOW TO MAKE\n          CHANGES ANY TIME INCLUDING FOR NO-SHOW.\n</pre>\n  </div>\n</div>',personsIDs:["0000-5d965a56-7db7-43b9-9937-7628c11cf2ba","0000-37c2ca33-570c-4b52-bbfc-af9ccb540a6c"]},{id:"0000-117e9abd-92ab-4b18-834a-9b252233c250",personCategory:{id:"CHILD",type:"personCategory"},code:"NLPXRF/CH25",info:'<div class="uptBlock">\n  <div class="uptFareCode">Код тарифа: NLPXRF/CH25</div>\n  <div class="uptCategory">\n    <div class="uptCategoryHeader">16. PENALTIES</div>\n    <pre class="uptCategoryParagraph">   FARE RULE\n   CANCELLATIONS\n   \n     ANY TIME\n       TICKET IS NON-REFUNDABLE IN CASE OF CANCEL/NO-SHOW/\n   REFUND.\n   \n   CHANGES\n   \n     ANY TIME\n       CHARGE RUB 2500 FOR REISSUE/REVALIDATION.\n   \n   CHANGES NOT PERMITTED IN CASE OF NO-SHOW.\n         NOTE - TEXT BELOW NOT VALIDATED FOR AUTOPRICING.\n          ---                ///\n          // CHANGES BEFORE OUTBOUND DEPARTURE //\n                             ///\n          1.WHEN THE FIRST FARE COMPONENT IS CHANGED -\n          THE ENTIRE TICKET MUST BE RE-PRICED USING\n          -CURRENT- FARES IN EFFECT ON THE DATE OF NEW\n          TICKET ISSUANCE.\n          ---\n          NEW FARE AMOUNT SHOULD BE EQUAL OR HIGHER THAN\n          PREVIOUS AMOUNT.\n          ---\n          ANY DIFFERENCE IN FARES PLUS CHANGE FEE MUST BE\n          COLLECTED.\n          ---\n          ALL RULE PROVISIONS OF THE NEW FARE INCLUDING\n          ADVANCE PURCHASE/MIN STAY/MAX STAY/\n          SEASONALITY/ETC MUST BE MET.\n          ---\n          2.WHEN THERE ARE NO CHANGE TO THE FIRST FARE\n          COMPONENT